import React from 'react';
import { Link } from 'react-router-dom';

export default function Footer() {
  const styles = {
    footer: {
      backgroundColor: '#001f42',
      color: '#ffffff',
      padding: '3rem 2rem 2rem',
      fontFamily: 'Segoe UI, sans-serif',
      fontSize: '0.95rem',
    },
    grid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(180px, 1fr))',
      gap: '2rem',
      maxWidth: '1200px',
      margin: '0 auto',
      borderBottom: '1px solid #444',
      paddingBottom: '2rem',
    },
    column: {
      textAlign: 'left',
    },
    heading: {
      fontSize: '1rem',
      fontWeight: 'bold',
      marginBottom: '1rem',
      color: '#ffa873',
    },
    link: {
      color: '#f2f2f2',
      textDecoration: 'none',
      marginBottom: '0.5rem',
      display: 'block',
    },
    bottom: {
      textAlign: 'center',
      fontSize: '0.8rem',
      color: '#ccc',
      marginTop: '2rem',
    }
  };

  return (
    <li>
      <a
        href="https://wa.me/61484791052"
        target="_blank"
        rel="noopener noreferrer"
      >
        WHATSAPP US
      </a>
    </li>
  );
}
